                "schema": "public",
                "sql": "SELECT time_bucket_gapfill('1 week', time) AS bucket,\n       city_normalized,\n       AVG(price_eur) AS \"avg_price\",\n       AVG(area) AS \"avg_area\",\n       AVG(rooms) AS \"avg_rooms\",\n       AVG(area_lot) AS \"avg_area_lot\",\n       locf(avg(price_eur)) AS \"avg_price_filled\"\nFROM public.es_top_cities\nWHERE time > TIMESTAMP '2021-06-10' AND time < now()\nGROUP BY bucket, city_normalized",
                "table_name": "avg_price_gapfilled",
